import { Box, Paper, Tab, TableContainer, Tabs } from '@mui/material'
import React, { useState } from 'react'
import TrainIcon from '@mui/icons-material/Train';
import BusAlertIcon from '@mui/icons-material/BusAlert';
import SignupComponent from './SignupComponent';
import {Link, Route, Routes} from 'react-router-dom'
import TrainTicketComponent from './trainTicket/trainTicketComponent';

export default function BookingComponent() {
    const [tabValue,setTabValue] = useState(0);
    const handleTabChange = (event,value) => {
        setTabValue(value)
    }
  return (
    <Paper>

        <Box justifyContent={'center'}>
            <Tabs value={tabValue} onChange={(event, value) => handleTabChange(event,value)} style={{justifyContent:'center'}}>
                <Tab label="Bus Ticket" icon={<BusAlertIcon></BusAlertIcon>} LinkComponent={Link} to={'/logs'} ></Tab>
                <Tab label="Train Ticket" icon={<TrainIcon></TrainIcon>}></Tab>
            </Tabs>
        </Box>
        <br></br>
        <Routes>
            <Route path='/logs' Component={<TrainTicketComponent />}></Route>
        </Routes>
        <SignupComponent></SignupComponent>

    </Paper>
  )
}
